@import 'globals', 'header', 'footer', 'homepage','slider', 'states',  'allPageStyling', 'underConstruction', 'contact', 'sitemap', 'responsiveMobile', 'responsiveTablet', 'responsiveLarger';


html {
    box-sizing: border-box;
}

*, *::before, *::after {
    box-sizing: inherit;
}

body {
  position: relative;
  font-family: 'Dosis', sans-serif;
  font-size: 1rem;
  margin: 0;
  padding: 0;
  min-height: 100vh;
  background: $offBlack;
}

.search-bar {
  border: 2px solid $offBlack;
  display: flex;
  border-radius: 1.5em;
  height: 35px;
  margin-bottom: .25em;
  box-shadow: 1px 1.5px 5px .5px $offBlack;

  &__input {
    flex-grow: 1;
    font-size: 1rem;
    padding: 0 0.5em;
    border: 0;
    background: transparent;

    &:focus {
      outline: 0;
    }
  }

  &__submit {
    font-size: 1.15rem;
    cursor: pointer;
    border: 0;
    background: transparent;
    border-radius: 50%;
  }
}

#nav-ul.show {
  display: flex;
  justify-content: center;
}

// Icons
.shop_cart {
  width: 24px;
  margin-left: .5em;
  margin-right: .5em;
}


// Fade in
.fade 
{
  -webkit-animation-name: fade-image;
  -webkit-animation-duration: 1.5s;
  animation-name: fade-image;
  animation-duration: 1.5s;
}

@-webkit-keyframes fade-image 
{
  from { opacity: .4 }
  to { opacity: 1 }
}

@keyframes fade-image 
{
  from { opacity: .4 }
  to { opacity: 1 }
}

@keyframes fadeinall {

    0% {
      opacity: 1; }

    97% {
      opacity: 0; }

    98% {
      opacity: 0;
      -webkit-transform: translateY(0);
      transform: translateY(0); }

    99% {
      opacity: 0;
      -webkit-transform: translateY(-100%);
      transform: translateY(-100%); }

    100% {
      opacity: 0;
      z-index: -1; } }

    #loader {
    opacity: 1;
    position: fixed;
    width: 100%;
    height: 100%;
    -webkit-transform: translateY(0);
    -ms-transform: translateY(0);
    transform: translateY(0);
    background-color: $offBlack;
    z-index: 999;
    animation-fill-mode: forwards;
    -webkit-animation: fadeinall 1s normal both;
    animation: fadeinall 1s normal both;
    -webkit-animation-delay: 0.3s;
    animation-delay: 0.3s; }
